import React, {Component} from 'react';

class Sam1 extends Component {
    constructor() {
      super();
      this.state = {
        message: "Hai I am Siva"
      };
    }
    changemessage() {
        this.setState ({
            message : "welcome all"
        })
    }
    render() {
      return (
        <div>
          <h1> {this.state.message}</h1>
          <button onClick={this.state.changemessage}></button>
        </div>
      );
    }
  }
export default Sam1;
